{
  "version": "0.2",
  "phases": {
    "install": {
      "runtime-versions": {
        "ruby": 2.6
      }
    },
    "build": {
      "commands": [
        "gem install bundler --version '1.17.3'",
        "bundle install"
      ]
    },
    "post_build": {
      "commands": [
        "echo \"In Post-Build Phase\"",
        "rm Gemfile.lock",
        "pwd; ls -al; cat Dockerrun.aws.json"
      ]
    }
  },
  "artifacts": {
    "files": "**/*"
  }
}
